import React, { Component } from 'react';
import Navigation from "./Components/Navigation";
import Foods from "./Components/Foods";
import './App.css';

class App extends Component {
  render() {
    return(
      <div>
        <div>
         <Navigation/> 
        </div>
        <div className="main-content">
        <Foods/>
        </div>      
      </div>
    );
  }
}

export default App;
